import React from 'react';

const PageTitle404 = () => {
    return (
        <section id="page-title">
            <div className="wrapper">
                <div className="title position-relative">
                    <h1>404<span className="dot">.</span></h1>
                </div>
            </div>
        </section>
    );
};

export default PageTitle404;
